    pay compensation for their employees to work for the committee either part time
    or full time. No payroll expenses are incurred. The committee maintains both Federal
    and non Federal accounts, and it has elected not to allocate its administrative
    expenses between accounts, so all administrative overhead expenses are paid 100
    percent with Federal funds. The Committee does not engage in any fundraising on
    behalf of candidates for Federal office, so all of its reported fund raising expenses
    are party fund raising.     The amendment to February 20 and March 20 monthly
    reports are caused by oversight of receipts from a new source, the political action
    committee ?Act Blue.?  New donor tracking software implemented in March 2008 by
    the Committee will prevent errors of this type from occurring in the future.   Amendment
    2 restates the cash on hand, beginning of period, which was omitted in Amendment
    1."
